import React from 'react'
import './Programs.css'

const programs = () => {
  return (
    <div className='Programs' id='programs'>
      {/* header */}
      <div className="Programs-header">
        <span>Explore Our</span>
        <span>Programs</span>
        <span>to shape you</span>
      </div>
      
    </div>
  )
}

export default programs;
